def countdown(seconds):
    while seconds >= 0:
        hours, remainder = divmod(seconds, 3600)
        mins, secs = divmod(remainder, 60)
        print(f"      Memulai spam kembali dalam {HH}{hours:02d}:{mins:02d}:{secs:02d}{P}", end="\r")
        time.sleep(1)
        seconds -= 1
    print("\n")

